import React, { useState } from 'react';
import "./PersonalDetails.css";
import { useParams } from 'react-router-dom';

export default function PersonalDetails() {

    const { userId } = useParams();

    const [ name, setname ] = useState();
    const [ gender, setGender ] = useState();
    const [ dob, setDob ] = useState();
    const [ phoneNo, setPhoneNo ] = useState();
    const [ address, setAddress ] = useState();
    const [ email, setEmail ] = useState();

    const changeGender = (event) => {
        setGender(event.target.value);
        console.log()
    }

  return (
    <section id='personaldetails'>
        <form id='personaldetailsform' >
            <label>
                Name : <input type='text' value={name} />
            </label>
            <label>
                Gender : <select value={gender} >
                    <option value={'M'}>Male</option>
                    <option value={'F'}>Female</option>
                </select>
            </label>
            <label>
                Phone Number : <input type='number' min={1000000000} max={9999999999} value={phoneNo} />
            </label>
            <label>
                Address : <textarea type='text' value={address} />
            </label>
            <label>
                Email : <input type='email' value={email} />
            </label>
        </form>
    </section>
  )
}
